import { Component } from 'react';
class CreateDataset extends Component {

    constructor(props) {
        super(props);
        this.state = {value: ''};

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    state = {
        serverUrl: 'http://localhost:5220/dataset',
        isLoaded: false,
        error: '',
        datasetOriginalJSON: JSON,
        datasetUserInputJSON: JSON,
    };



    componentDidMount() {

    }

    handleChange(event) {
        this.setState(
            {datasetUserInputJSON : event.target.value}
        )
    }

    handelSubmitRequest() {
        console.log('You clicked submit.');
        console.log(JSON.stringify(this.state.datasetUserInputJSON))
    }

    render() {
        return (
            <div>
                <h2>Create Or Update Dataset</h2>
                <form onSubmit={this.handelSubmitRequest}>
                    <label>
                        <textarea defaultValue={JSON.stringify(this.state.datasetOriginalJSON)}  onChange={this.handleChange}/>
                    </label>
                    <input type="submit" value="Submit JSON" />
                </form>
            </div>
        )
    }

}

export default CreateDataset
